import Axios from "axios";
import { apiClient } from "./apiClient";
import axios from "axios";

export const GetShedulePerDay = async (sheduleId, sheduleDay) => {
  await axios
    .get("http://172.17.59.113:51044/asd/shedules/1/1")
    .then((res) => console.log(res))
    .catch((err) => console.log(err));
};
